import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div
        class="input-group"
        style={{ backgroundColor: "lightBlue", padding: "10px" }}
      >
        <input
          type="text"
          placeholder="Hae Kalenteria"
          aria-label="Hae Kalenteria"
        ></input>

        <div class="input-group-append">
          <button class="btn btn-outline-secondary" type="button">
            Hae
          </button>
        </div>

        <button
          className="btn btn-outline-secondary"
          type="button"
          style={{
            boxSizing: "border-box",
            width: 120,
            marginLeft: window.outerWidth - 180,
            position: "absolute",
            float: "right",
          }}
        >
          Uusi kalenteri
        </button>
        <div>window.innerWidth</div>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: lightblue";
    return styles;
  }
}

export default Navbar;
